//import React, {component} from 'react';
//import { BrowserRouter, Routes, Route } from 'react-router-dom';
import {Link, Router} from 'react-router-dom';
import Guide from './Guide';

function NavBar() {
    return(
        <div>
            <div id="nav">
                <a href=""><img src={require('./images/logo.png')} alt="logo" /></a>
                <ul>
                <Router>
                <li>
                    <Link to="/Guide" className="nav1">WORKSPACE</Link>
                </li>
                <li><a href="" className="nav1">TEMPLATE</a></li>
                <li><a href="" className="nav1">GUIDE</a></li>
                <li><a href="" className="nav1">MYPAGE</a></li>
                <li><a href="" className="logoutB">logout</a></li>
                </Router>
                </ul> 
            </div>
        </div>
    )
}

export default NavBar;
